import React,{Component} from 'react';
import './Bloque.css';

class Bloque_CPU extends Component{
    render(){
        return(
            <div className="Bloque_CPU">
                <header>
                    <p>{this.props.titulo}</p>
                </header>
            </div>
        );
    }
};


export default Bloque_CPU;
